    const [personaje, setPersonaje] = useState([])

    useEffect(() => {
        getDatos()
    }, [])


    const getDatos = async () => {
        const req = await axios.get("https://swapi.dev/api/people/");
        const reqs = req.data.results;
        // console.log(reqs);
        setPersonaje(reqs)
    }

    return (
        <div>
            <div className="container">

                <div className="container">
                    <h1>
                        personajes
            </h1>
                    <br />
                    {
                        personaje.map((item, id) => (
